        justifyContent: "center",
    },
    mainDiv: {
        textAlign: "justify",
        maxWidth: "620px",
    },
    headerText: {
        backgroundColor: "yellow",
        color: "black",
        width: "25%",
        fontWeight: "600",
        fontSize: "25px",
    },
    subHeading: {
        fontSize: "12px",
        color: "black",
      },
    subHeading1: {
        fontSize: "12px",
        color: "#a7a0a0",
      },
    subHeading2: {
